    return (
        <>
            <div className="row">
                <div className="col-12">
                    {/*<Navbar></Navbar>*/}
                </div>
            </div>
            <div className="row">
                <div className="col-12">
                    <Outlet></Outlet>
                </div>
            </div>
        </>
    )
}
